package youtubedlwrapper

import (
	"encoding/base64"
	"encoding/json"
	"os/exec"
	"testing"
)

func TestYoutubeDLWrapper_GetMetaData(t *testing.T) {
	t.Parallel()

	decodedBase64, err := base64.StdEncoding.DecodeString(testVideos[0].base64json)
	if err != nil {
		t.Errorf("testVideo (%v), could not decode base64 error (%v)\n", testVideos[0].name, err)
	}

	cmdMocker := commandMocker{
		stdinData:  "",
		stdoutData: string(decodedBase64),
		stderrData: "",
	}

	//todo: dont use new, since it checks local filesystem for binary
	youtubeDLWrapper, err := New(WrapperOptions{YoutubeDLBinary: "youtube-dl"})
	if err != nil {
		t.Error(err)
		return
	}
	youtubeDLWrapper.wrapperOptions.cmd = cmdMocker.makeMockCommand

	metadata, err := youtubeDLWrapper.GetVideoMetadata("https://www.youtube.com/watch?v=lfW5CF0Nsis")
	if err != nil {
		t.Error(err)
		return
	}

	if metadata.ID == "" {
		t.Error("Metadata doesnt exist after error isn't nil")
	}

	cmdMocker.runErr = &exec.ExitError{
		ProcessState: nil,
		Stderr:       []byte("status code 1"),
	}
	cmdMocker.stderrData = "status code 1"
	_, err = youtubeDLWrapper.GetVideoMetadata("https://www.youtube.com/watch?v=lfW5CF0NsiBADURL")
	if err != nil {
		return
	}

	t.Error("Did not receive an error from bad url passed to youtube-dl")
}

type TestVideo struct {
	name          string
	base64json    string
	videoMetadata VideoMetadata
}

