func Test_CheckValidTestVideos(t *testing.T) {
	for _, test := range testVideos {
		decodedBase64, err := base64.StdEncoding.DecodeString(test.base64json)
		if err != nil {
			t.Errorf("testVideo (%v), could not decode base64 error (%v)\n", test.name, err)
		}
		videoMetadata := VideoMetadata{}
		err = json.Unmarshal(decodedBase64, &videoMetadata)
		if err != nil {
			t.Errorf("testVideo (%v), could not unmarshal decodedBase64 into VideoMetadata, error (%v)\n", test.name, err)
		}

		//todo: check against test.videoMetadata
	}
}
